std::string read_markdown(std::string const& text)
{
	std::string html;

	// extract text as a string
	std::string::size_type pos = 0;
	while (pos < text.size())
	{
		// split the string at the start of the markdown
		std::string::size_type pos1 = text.find("*", pos);
		if (pos1 == std::string::npos)
		{
			// there is no markdown
			break;
		}

		// skip the markdown
		pos = pos1 + 1;
		std::string::size_type pos2 = text.find("*", pos1);
		if (pos2 == std::string::npos)
		{
			// there is no html
			break;
		}

		// trim the html
		text.erase(pos1, pos2 - pos1);
		pos1 = pos2 + 1;
	}

	// return the html string
	return html;
}
